          backgroundColor: '#eceff1'
        },
        media: {
            height: 50,
          },
        bullet: {
          display: 'inline-block',
          margin: '0 2px',
          transform: 'scale(0.8)',
        },
        title: {
          fontSize: 14,
        },
        pos: {
          marginBottom: 12,
        },
      };

      const Style_chip = {
            maxWidth: 50,
            marginLeft:5,
            position:'relative',
            right: 100

      }


      const Style_visa = {
        maxWidth: 50,
        marginLeft:5,
        position:'relative',
        left: 100
      }

    const style_bullet = {
        padding: 5,
        margin: 5,
        display: 'inline-block'
    }
    const style_bullet2 = {
        padding: 2,
        margin: 2,
        position:'relative',
        display: 'inline-block',
        left:120
    }
    const bullet1 = ()=>{

        return(
            <div style={style_bullet}>
                <span className='bullet'>• </span>
                <span className='bullet'>• </span>
                <span className='classes'>• </span>
                <span className='classes'>• </span>
            </div>
        )
     }

     const bullet2 = ()=>{

        return(
            <div style={style_bullet2}>
                <span className='bullet'>• </span>
                <span className='bullet'>• </span>
            </div>
        )
     }


      function SimpleCard(props) {
        const { classes } = props;
        const Bullet = bullet1;
        const Bullet2 = bullet2;

        return (
          <Card className={classes.card}>
            <CardContent>
              <img style = {Style_chip} src="http://jamesdelaney.ie/dev/chip.png" alt="chip"/>
              <img style = {Style_visa} src="https://webiconspng.com/wp-content/uploads/2017/09/Visa-PNG-Image-76712.png" alt="visa" />
              <Typography variant="h5" component="h2">
                <tr>
                    <td>
                    <Bullet />
                    </td>
                    <td>
                    <Bullet />  
                    </td>
                    <td>
                    <Bullet/>  
                    </td>
                    <td>
                    <Bullet/>  
                    </td>
                </tr>
              </Typography>
              <Typography variant="Title" component="h6" align="right">
                valid thru
              </Typography>
              <tr>
                <td>
                    <Typography variant="subheading" component="h6" align="left">
                    YOUR NAME HERE
                    </Typography>
                </td>
                <td>
                    <Typography variant="Title" component="h6" align="right" >
                        <Bullet2 />
                        <Bullet2 /> 
                    </Typography>
                </td>
              </tr>
            </CardContent> 
          </Card>
        );
      }

      SimpleCard.propTypes = {
        classes: PropTypes.object.isRequired,
      };

     export default withStyles(styles)(SimpleCard);
